	string telemetry_name = 2;
	string session_id = 3;
	string request_id = 4;
	int64 server_timestamp_ms = 5;
}

//----- End telemetry -----
//------------------------------
//----- Begin token -----

// ref: Niantic.Platform.Auth.Token.AppleToken
message AppleToken {
	string id_token = 1;
}

// ref: Niantic.Platform.Auth.Token.FbTokenProto
message FbTokenProto {
	string token = 1;
}

// ref: Niantic.Platform.Auth.Token.GoogleToken
message GoogleToken {
	string id_token = 1;
}

// ref: Niantic.Platform.Auth.Token.SuperAwesomeTokenProto
message SuperAwesomeTokenProto {
	string token = 1;
}

//----- End token -----
//------------------------------
//----- Begin vasa -----

// ref: Niantic.Vasa.CollectAdIdRequestProto
message CollectAdIdRequestProto {
	// ref: Niantic.Vasa.CollectAdIdRequestProto/Types/CollectionFailedReason
	enum CollectionFailedReason {
		REASON_INVALID = 0;
		AD_TRACKING_DISABLED = 1;
	}

	// ref: Niantic.Vasa.CollectAdIdRequestProto/Types/DevicePlatform
	enum DevicePlatform {
		PLATFORM_INVALID = 0;
		ANDROID = 1;
		IOS = 2;
	}

	string user_id = 1;
	string ad_id = 2;
	DevicePlatform device_platform = 3;
	CollectionFailedReason failed_reason = 4;
	uint64 timestamp_ms = 5;
}

// ref: Niantic.Vasa.CollectAdIdResponseProto
message CollectAdIdResponseProto {
	// ref: Niantic.Vasa.CollectAdIdResponseProto/Types/Status
	enum Status {
		INVALID = 0;
		SUCCESS = 1;
		ERROR = 2;
	}

	Status status = 1;
}

// ref: Niantic.Vasa.VasaClientAction
message VasaClientAction {
	// ref: Niantic.Vasa.VasaClientAction/Types/ActionEnum
	enum ActionEnum {
		INVALID_VASA_CLIENT_ACTION = 0;
		COLLECT_ADID = 8000;
	}

}

//----- End vasa -----
//------------------------------
